import React from 'react';
import './App.css';
import {BrowserRouter, Switch, Route} from 'react-router-dom'
import About from './components/About';
import Landing from './components/Landing';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/about">
        <About></About>
        </Route>
        <Route path="/" exact>
        <Landing></Landing>
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
